import React from 'react'

const ProduitsUn = ({item}) => {
  return (
    <div className=''>
        <img src={item.image} alt="" />
        <h2>Nom: {item.Nomdeproduit}</h2>
        <div>Marque: {item.Marque}</div>
        <div>Taille: {item.taille} </div>
        <div>Pris: {item.pris} </div>
    </div>
  )
}

export default ProduitsUn
